import React from "react";
import { productlist } from "../ProductDummy";
import SuggestDymmy from "./SuggestDummy";
import styled from "styled-components";

export default function Suggest() {
  return (
    <SuggestContinaer>
      {productlist.map((item) => {
        return (
          <SuggestDymmy text={item.text} url={item.url} price={item.price} />
        );
      })}
    </SuggestContinaer>
  );
}

export const SuggestContinaer = styled.div`
  /* position: relative;
  width: 1050px;
  margin: 0px auto; */
`;
